import { useEffect } from "react";
import "../scss/ban.css";
import $ from "jquery";


export default function Circle(){

    const circle = $(".album_set");
    const upScale_Circle = () => {
        circle.click(function() {
            console.log("클클")
        })
        // circle.toggleClass("on");
    }

    upScale_Circle()

    // useEffect(()=>{
    //     $(".album_set").click(function(){
    //         console.log("클릴")
    //     });
    // },[])

    return(
        <>
            <div className="circle_wrapper">
                <div className="circle"></div>
            </div>
        </>
    )
}
